import React from 'react';

export default class TopNav extends React.Component {
    state = {
        topNavElement: ['Men', 'Women', 'Kids', 'Home&Living', 'Beauty']
    }

    render() {
        const { topNavElement } = this.state
        return (
            <>
                <div className="logo">Logo</div>

                {
                    topNavElement.map((v, k) => {
                        return (
                            <div>{v}</div>
                        )
                    })
                }
            </>
        )
    }
}
